function openUrl(url) {
  const platform = process.platform;
  let command;
  
  switch (platform) {
    case 'darwin': // macOS
      command = `open "${url}"`;
      break;
    case 'win32': // Windows
      command = `start "${url}"`;
      break;
    case 'linux': // Linux
      command = `xdg-open "${url}"`;
      break;
    default:
      console.error(' Unsupported platform:', platform);
      return;
  }
  
  exec(command, (error) => {
    if (error) {
      console.error(' Error opening URL:', error);
    } else {
      console.log(' Successfully opened:', url);
    }
  });
}

function makeApiCall() {
  console.log(' Making API call to create input image...');
  console.log(' API URL:', API_URL);
  
  const url = new URL(API_URL);
  const postData = JSON.stringify(requestData);
  
  const options = {
    hostname: url.hostname,
    port: url.port || 443,
    path: url.pathname,
    method: 'POST',
    headers: {
      'Content-Type': 'application/json',
      'Authorization': `Bearer ${BEARER_TOKEN}`,
      'Content-Length': Buffer.byteLength(postData)
    }
  };
  
  const req = https.request(options, (res) => {
    let data = '';
    
    console.log(` Response status: ${res.statusCode}`);
    
    res.on('data', (chunk) => {
      data += chunk;
    });
    
    res.on('end', () => {
      try {
        const response = JSON.parse(data);
        console.log(' Response received:');
        console.log(JSON.stringify(response, null, 2));
        
        if (response.status === 'success' && response.response && response.response.link) {
          const link = response.response.link;
          console.log(` Opening link: ${link}`);
          
          // Check if the link contains webhook source parameters
          if (link.includes('source=webhook') || link.includes('source=revit')) {
            console.log(' Detected webhook source - masks and AI materials will be processed automatically');
          }
          
          openUrl(link);
        } else {
          console.error(' No link found in response or request failed');
          console.error('Response:', response);
        }
      } catch (error) {
        console.error(' Error parsing response:', error);
        console.error('Raw response:', data);
      }
    });
  });
  
  req.on('error', (error) => {
    console.error(' API request error:', error);
  });
  
  req.write(postData);
  req.end();
}

